    public function mapData($datas)
    {
        $lists = array();
        foreach ($datas AS $data) {
            $iten['users'] = array(
                'id' => $data['id'],
                'username' => $data['username'],
                'email' => $data['email'],
                'email_verified' => $data['email_verified'],
                'phone' => $data['phone'],
                'phone_verified' => $data['phone_verified'],
                'facebook_uid' => $data['facebook_uid']
